style.css:
@font-face {
    font-family: 'Inter';
    src: url('https://fonts.gstatic.com/s/inter/v4/UcCjGfxJHrNJPY8xLHp3Kw.woff2') format('woff2');
    font-weight: 400; /* Normal weight */
    font-style: normal; /* Normal style */
}

body, p, h1, h2, h3, h4, h5, h6, div, span, a, li, ul, ol, button, input, textarea, select {
